import React from 'react';
import { url } from '../../config';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';

const CategoryItem = ({ category: { title, iconActive, iconInactive, iconHover } }) => {
    return (
        <div className="col">
            <div className="inner-category active">
                <div className="icon-wrap" data-category={title}>
                    <img id="icon-image" src={`${url}${iconActive}`} />
                    <Link id="icon-link" className="active-link" href="#!">{title}</Link>
                </div>
            </div>
        </div>
    )
}

export default connect(null, {})(CategoryItem);
